    function goback(){
        navigate(-1);
    }

    return(
        <>        
            <header className="navbar">
                <button className="button_welcome" onClick={goback}> Back </button>
            </header>
            <div className="rule_layout">

                <h1>How to Play</h1>
                <div>Guess the Wordle in _ tries</div>
                <li>Each guess must be a valid _-letter word.</li>
                <li>The color of the tiles will change to show how close your guess was
                    to the word.
                </li>
                <h3>Examples</h3>
                <li>in the word and correct spot.</li>
                <li>in the word but wrong spot.</li>
